import React, { useState } from "react";
import CreateNote from "./CreateNote";
import Note from "./Note";

const AppTodo = () =>{

    const [additm, setAddItem] = useState([]);

    const addNote = (note) =>{
        setAddItem((prevData)=>{
            return [...prevData, note];
        }); 
    };

    return (
        <>
        <CreateNote passNote={addNote}/>
        <Note/>
        </>
    );

};

export default AppTodo;
